function EditProfilePopup() {
  return (
    <PopupWithForm
      title="Редактировать профиль"
      name="edit"
      isOpen={isEditProfilePopupOpen}
      onClose={closeAllPopups}
    >
      <PopupEditProfile />
    </PopupWithForm>
  );
}

export default EditProfilePopup;
